script: |
  super -f text -I q6160.spq | sort > q6160.out

inputs:
  - name: q6160.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + + col2 NOT BETWEEN - 80 + + col0 * - col0 AND + col1;
  - name: tab0

outputs:
  - name: q6160.out
    data: |
      15	81	47
      87	21	10
